import styled from 'styled-components';

export const DeleteModalContent = styled.div`
  text-align: center;
  padding: 15px;
  background-color: #fff;
  border-radius: 8px;
  width: 250px;

`;

export const NameDelete = styled.h3`
    margin-bottom: 20px;
`;

export const EditButton = styled.button`
padding: 10px 20px;
margin: 10px;
cursor: pointer;
border: none;
border-radius: 5px;
background-color: #ff4d4d;
color: white;
